exports.push([module.i, "\n.menu {\n    position: fixed;\n    top: 30px;\n    left: 10px;\n    padding: 0;\n    list-style: none;\n    max-width: 230px;\n    font-size: 18px;\n}\n.menu-item {\n    cursor: pointer;\n    margin-bottom: 20px;\n}\n.main {\n    margin-left: 300px;\n    font-size: 25px;\n}\n.active {\n    color: #178ce6;\n    border-left: 1px solid #178ce6;\n    padding-left: 5px;\n    transition: all 0.5s;\n}\n", "", {"version":3,"sources":["/Users/lingchenxuan/Desktop/work/vue2-scrollspy/docs/src/demo.vue?6ab6869e"],"names":[],"mappings":";AA4CA;IACA,gBAAA;IACA,UAAA;IACA,WAAA;IACA,WAAA;IACA,iBAAA;IACA,iBAAA;IACA,gBAAA;CACA;AACA;IACA,gBAAA;IACA,oBAAA;CACA;AACA;IACA,mBAAA;IACA,gBAAA;CACA;AACA;IACA,eAAA;IACA,+BAAA;IACA,kBAAA;IACA,qBAAA;CACA","file":"demo.vue","sourcesContent":["<template>\n    <div class=\"container\">\n        <ul class=\"menu\">\n            <li v-for=\"(item, index) in titles\" class=\"menu-item\" :class=\"{active:scrollPos == index}\">\n                <a @click=\"$scrollTo(index)\">{{item}}</a>\n            </li>\n        </ul>\n        <div class=\"main\" v-scroll-spy=\"scrollPos\">\n            <div>\n                <h1>Ludwig van Beethoven </h1>\n                <p>\n                    (Listeni/ldv vn betovn/, /bethovn/; German: [lutv fan bethofn] ( listen); baptised 17 December 1770[1]  26 March 1827) was a German composer and pianist. A crucial figure in the transition between the Classical and Romantic eras in Western art music, he remains one of the most famous and influential of all composers. His best-known compositions include 9 symphonies, 5 piano concertos, 1 violin concerto, 32 piano sonatas, 16 string quartets, his great Mass the Missa solemnis, and one opera, Fidelio.\n                    Born in Bonn, then the capital of the Electorate of Cologne and part of the Holy Roman Empire, Beethoven displayed his musical talents at an early age and was taught by his father Johann van Beethoven and by composer and conductor Christian Gottlob Neefe. At the age of 21 he moved to Vienna, where he began studying composition with Joseph Haydn, and gained a reputation as a virtuoso pianist. He lived in Vienna until his death. By his late 20s his hearing began to deteriorate, and by the last decade of his life he was almost totally deaf. In 1811 he gave up conducting and performing in public but continued to compose; many of his most admired works come from these last 15 years of his life.\n                </p>\n            </div>\n            <div>\n                <h1>Biography</h1>\n                <p>Beethoven was the grandson of Ludwig van Beethoven (171273), a musician from the town of Mechelen in the Duchy of Brabant in the Flemish region of what is now Belgium, who at the age of twenty moved to Bonn.[2][3] Ludwig (he adopted the German cognate of the Dutch Lodewijk) was employed as a bass singer at the court of the Elector of Cologne, eventually rising to become, in 1761, Kapellmeister (music director) and thereafter the pre-eminent musician in Bonn. The portrait he commissioned of himself towards the end of his life remained proudly displayed in his grandson's rooms as a talisman of his musical heritage.[4] Ludwig had one son, Johann (17401792), who worked as a tenor in the same musical establishment and gave keyboard and violin lessons to supplement his income.[2] Johann married Maria Magdalena Keverich (de) in 1767; she was the daughter of Johann Heinrich Keverich (17011751), who had been the head chef at the court of the Archbishopric of Trier.[5]</p>\n                <p>Beethoven was born of this marriage in Bonn. There is no authentic record of the date of his birth; however, the registry of his baptism, in a Catholic service at the Parish of St. Regius on 17 December 1770, survives.[6] As children of that era were traditionally baptised the day after birth in the Catholic Rhine country, and it is known that Beethoven's family and his teacher Johann Albrechtsberger celebrated his birthday on 16 December, most scholars accept 16 December 1770 as Beethoven's date of birth.[7][8] Of the seven children born to Johann van Beethoven, only Ludwig, the second-born, and two younger brothers survived infancy. Caspar Anton Carl was born on 8 April 1774, and Nikolaus Johann, the youngest, was born on 2 October 1776.[9]\n\n                    Beethoven's first music teacher was his father. He later had other local teachers: the court organist Gilles van den Eeden (d. 1782), Tobias Friedrich Pfeiffer (a family friend, who provided keyboard tuition), and Franz Rovantini (a relative, who instructed him in playing the violin and viola).[2] From the outset his tuition regime, which began in his fifth year, was harsh and intensive, often reducing him to tears; with the involvement of the insomniac Pfeiffer there were irregular late-night sessions with the young Beethoven being dragged from his bed to the keyboard.[10] Beethoven's musical talent was obvious at a young age. Johann, aware of Leopold Mozart's successes in this area (with his son Wolfgang and daughter Nannerl), attempted to promote his son as a child prodigy, claiming that Beethoven was six (he was seven) on the posters for Beethoven's first public performance in March 1778.[11]\n\n                    Some time after 1779, Beethoven began his studies with his most important teacher in Bonn, Christian Gottlob Neefe, who was appointed the Court's Organist in that year.[12] Neefe taught Beethoven composition, and by March 1783 had helped him write his first published composition: a set of keyboard variations (WoO 63).[9] Beethoven soon began working with Neefe as assistant organist, at first unpaid (1781), and then as a paid employee (1784) of the court chapel conducted by the Kapellmeister Andrea Luchesi. His first three piano sonatas, named \"Kurfrst\" (\"Elector\") for their dedication to the Elector Maximilian Friedrich (17081784), were published in 1783. Maximilian Frederick noticed Beethoven's talent early, and subsidised and encouraged the young man's musical studies.[13]\n\n                </p>\n            </div>\n            <div>\n                <h1>Personal and family difficulties</h1>\n                <p>Beethoven's love life was hampered by class issues. In late 1801 he met a young countess, Julie (\"Giulietta\") Guicciardi through the Brunsvik family, at a time when he was giving regular piano lessons to Josephine Brunsvik. Beethoven mentions his love for Julie in a November 1801 letter to his boyhood friend, Franz Wegeler, but he could not consider marrying her, due to the class difference. Beethoven later dedicated to her his Sonata No. 14, now commonly known as the Moonlight sonata or Mondscheinsonate (in German).[69]\n                    Fr Elise\n                    MENU0:00\n                    Problems playing this file? See media help.\n                    His relationship with Josephine Brunsvik deepened after the death in 1804 of her aristocratic first husband, the Count Joseph Deym. Beethoven wrote Josephine 15 passionate love letters from late 1804 to around 1809/10. Although his feelings were obviously reciprocated, Josephine was forced by her family to withdraw from him in 1807. She cited her \"duty\" and the fact that she would have lost the custodianship of her aristocratic children had she married a commoner.[70] After Josephine married Baron von Stackelberg in 1810, Beethoven may have proposed unsuccessfully to Therese Malfatti, the supposed dedicatee of \"Fr Elise\";[71][72] his status as a commoner may again have interfered with those plans.\n                    Life mask made in 1812\n                    In the spring of 1811 Beethoven became seriously ill, suffering headaches and high fever. On the advice of his doctor, he spent six weeks in the Bohemian spa town of Teplitz. The following winter, which was dominated by work on the Seventh symphony, he was again ill, and his doctor ordered him to spend the summer of 1812 at the spa Teplitz. It is certain that he was at Teplitz when he wrote a love letter to his \"Immortal Beloved\".[73] The identity of the intended recipient has long been a subject of debate; candidates include Julie Guicciardi, Therese Malfatti, Josephine Brunsvik, and Antonie Brentano.\n                    Beethoven visited his brother Johann at the end of October 1812. He wished to end Johann's cohabitation with Therese Obermayer, a woman who already had an illegitimate child. He was unable to convince Johann to end the relationship and appealed to the local civic and religious authorities. Johann and Therese married on 9 November.[74]\n                    Beethoven in 1814. Portrait by Louis-Ren Ltronne.\n                    In early 1813 Beethoven apparently went through a difficult emotional period, and his compositional output dropped. His personal appearance degradedit had generally been neatas did his manners in public, especially when dining. Beethoven took care of his brother (who was suffering from tuberculosis) and his family, an expense that he claimed left him penniless.\n                    Beethoven was finally motivated to begin significant composition again in June 1813, when news arrived of the defeat of one of Napoleon's armies at Vitoria, Spain, by a coalition of forces under the Duke of Wellington. This news stimulated him to write the battle symphony known as Wellington's Victory. It was first performed on 8 December, along with his Seventh Symphony, at a charity concert for victims of the war. The work was a popular hit, probably because of its programmatic style, which was entertaining and easy to understand. It received repeat performances at concerts Beethoven staged in January and February 1814. Beethoven's renewed popularity led to demands for a revival of Fidelio, which, in its third revised version, was also well received at its July opening. That summer he composed a piano sonata for the first time in five years (No. 27, Opus 90). This work was in a markedly more Romantic style than his earlier sonatas. He was also one of many composers who produced music in a patriotic vein to entertain the many heads of state and diplomats who came to the Congress of Vienna that began in November 1814. His output of songs included his only song cycle, \"An die ferne Geliebte,\" and the extraordinarily expressive second setting of the poem \"An die Hoffnung\" (Op. 94) in 1815. Compared to its first setting in 1805 (a gift for Josephine Brunsvik), it was \"far more dramatic ... The entire spirit is that of an operatic scena.\"[75]</p>\n            </div>\n        </div>\n    </div>\n</template>\n<style>\n    .menu {\n        position: fixed;\n        top: 30px;\n        left: 10px;\n        padding: 0;\n        list-style: none;\n        max-width: 230px;\n        font-size: 18px;\n    }\n    .menu-item {\n        cursor: pointer;\n        margin-bottom: 20px;\n    }\n    .main {\n        margin-left: 300px;\n        font-size: 25px;\n    }\n    .active {\n        color: #178ce6;\n        border-left: 1px solid #178ce6;\n        padding-left: 5px;\n        transition: all 0.5s;\n    }\n</style>\n<script>\n    export default{\n        data(){\n            return{\n                scrollPos: 0,\n                titles: [\n                  'Ludwig van Beethoven',\n                  'Biography',\n                  'Personal and family difficulties'\n                ]\n            }\n        }\n    }\n</script>\n"],"sourceRoot":""}]);

